import React from "react";
import {Container, AppBar, Typography, Grow, Grid} from '@mui/material';

const App = () => {
    return(
        <Container maxWidth='lg'>
            <AppBar position="static" color="inherit">
                <Typography variant="h2" align="center">Memories/Events</Typography>
            </AppBar>
            <Grow in>
                <Grid container justify ="space between" al></Grid>
            </Grow>
        </Container>
    )
}
export default App;
